import React, {useEffect, useState} from 'react';
import './App.css';

function App() {
  var [currentQuestion, setCurrentQuestion] = useState("");
  var [currentQuestioner, setCurrentQuestioner] = useState("");
  var [previewQuestion, setPreviewQuestion] = useState("");
  var [previewQuestioner, setPreviewQuestioner] = useState("");

  useEffect(() => {
    // target= document.getElementsByClassName(Form_ID_Box)[0].value;
    fetch("http://localhost:5000/?question=5&id=1X6qxNWpj31C3wFc-T_8yeLlsZKsUYimvHtKaG6hJ8QU").then(response =>
      response.json().then(data => {
        setPreviewQuestioner(data.values[0][0]);
        setPreviewQuestion(data.values[0][1]);
      })
    );
    fetch("http://localhost:5000/?question=4&id=1X6qxNWpj31C3wFc-T_8yeLlsZKsUYimvHtKaG6hJ8QU").then(response =>
      response.json().then(data => {
        setCurrentQuestioner(data.values[0][0]);
        setCurrentQuestion(data.values[0][1]);
      })
    );
  }, [])

  return (
    <div className="App">
     <div className="Controls">
       <form>
        <label>
          Form ID
         <input className="Form_ID_Box" type="text" name="preview" />
        </label>
        <input type="submit" />
     </form>
      <form>
        <label>
          Preview Question Number
         <input className="Preview_Question_Number_Box" type="text" name="preview" defaultValue="2" />
        </label>
        <input type="submit" defaultValue="Update Preview" />
      <button onClick={function() {
        setCurrentQuestioner({previewQuestioner});
        setCurrentQuestion({previewQuestion});
        fetch("http://localhost:5000/?question=5&id=1X6qxNWpj31C3wFc-T_8yeLlsZKsUYimvHtKaG6hJ8QU").then(response =>
         response.json().then(data => {
            setPreviewQuestioner(data.values[0][0]);
            setPreviewQuestion(data.values[0][1]);
          })
        );
        }}>
        Skip
      </button>
      <button className="Answer_Button" onClick={function() {
        // setCurrentQuestion({previewQuestion});
        fetch("http://localhost:5000/?question=5&id=1X6qxNWpj31C3wFc-T_8yeLlsZKsUYimvHtKaG6hJ8QU").then(response =>
         response.json().then(data => {
            setCurrentQuestioner(data.values[0][0]);
            setCurrentQuestion(data.values[0][1]);
          })
        );
        }}>
        Answer
      </button>
     </form>
     </div>
     <div className="Preview">
      <p className="previewQuestioner">{previewQuestioner}</p>
      <p className="previewQuestion">{previewQuestion}</p>
     </div>
     <div className="Live">
      <p className="currentQuestioner">{currentQuestioner}</p>
      <p className="currentQuestion">{currentQuestion}</p>
     </div>
    </div>
  );
}

export default App;
